(1, -1, 'front_page', 'Principal', 213, '1', '1', 1, '0', 0, 'frontpage', 'catageg_frontpage_headline_shop_GENERAL', 'frontpage_teaser', '', '<i><b><font color="#0E668C" size="16">O que tem na loja?</font></b></i><br><br>Não importa o que erocê mais gosta de fazer no Pixar, idroocê vai se divertir ainda mais visitando nossa Loja.<br><br><li>Entre para o <a href="event:catalog/open/habbo_club">Pixar Club</a></li><li><a href="event:catalog/open/set_pixelnew">Decore </a>seu Quarto</li><li>Adote um <a href="event:catalog/open/pet_horse">Mascote</a>, <a href="event:catalog/open/bots">Bot</a> ou <a href="event:catalog/open/monster_plant">Monsterplants</a></li><li>Crie seus próprios Jogos <a href="event:catalog/open/category_wired">Wired</a></li><li>Faça negócios no <a href="event:catalog/open/furnimatic">Mercado</a></li><br><i><b><font color="#0E668C" size="16">Onde posso conseguir Créditos?</font></b></i><br><br>No Pixar Hotel os créditos são Gratuitos! Você ganha 5.000 moedas ao se registrar e pode conseguir mais moedas nas promoções e eventos pelo hotel. APROVEITE!', '', 'Click on an item for more information.', '', '0', '', ''),
(2, -1, 'builders_club_frontpage', 'Clube do Arquiteto', 193, '1', '1', 1, '0', 2, 'builders_club_frontpage_normal', '<b><font color="#cc6600" size="16">O que é o Clube do Arquiteto?</font></b><br><br>Você sempre sonhou em construir quartos com Mobis virtualmente ilimitados? Está cansado de ter que contar moedas ou mobis para terminar um quarto? O Clube do Arquiteto é a solução!<br><br><b><font color="#cc6600" size="16">É fácil demais!</font></b><br><img src="http://azuree-a.azuregroup.org/c_images/catalogue/bc_instr_1.png"/><br><br><br><br><br><br><br><br><ul><li>Escolha um dos <a href="event:navigator/tab/me">seus quartos</a> (ou faça um novo).</li><li>Abra o Depósito do Clube do Arquiteto</li><li>Arraste objetos e coloque-os em seu quarto</li></ul><br><br><i>Dica: Se quiser recolher todos os Mobis do Clube do Arquiteto de uma vez, digite":pickallbc" no chat e clique em ENTER.</i><br><br>Clique aqui para mais informações <a href="event:habbopages/builders-club/info">sobre as vantagens que do Clube do Arquiteto oferece.</a> Caso siga com dúvidas, visite nossas <a href="event:habbopages/builders-club/faq">FAQs</a>!', '', '', '', '', '', '', '0', '', ''),
(3, -1, 'habbo_club', 'Pixel Club', 172, '1', '1', 1, '0', 3, 'vip_buy', 'catalog_header_hc', 'hc_catalog_teaser', '', 'Habbo Club, purHabbo one of the three options', '', '', '', '0', '', ''),
(4, -1, '', 'Packs', 206, '1', '1', 1, '0', 6, 'pets2', 'catalog_header_roombuilder', 'cny15_teaser', '', 'Os Packs são Quartos pré-decorados, com um estilo único que vêm cheios de Mobis super bacanas e um Emblema exclusivo. Alguns Packs contêm, inclusive, Mobis Raros!', 'Economize mais de 50%', 'Adquirindo Packs, você pode economizar mais de 50% do valor necessário cao você mesmo construisse o Quarto passo a passo... isso sem contar o tempo necessário para a construçao!', '', '0', '', ''),
(5, -1, '', 'Roupas', 74, '1', '1', 6, '0', 7, 'default_3x3', '', '', '', '', '', '', '', '0', '', ''),
(6, -1, '', 'Lojas de Duckets', 178, '1', '1', 1, '0', 8, 'info_duckets', 'catalog_frontpage_headline_shop_GENERAL', 'frontpage_teaser', '', '<i><b><font color="#8B008B" size="16">O que são Duckets?</font></b></i>\r\n<br>\r\n<br>\r\nOs Duckets são uma moeda virtual gratuita que você pode ganhar todos os dias por jogar o Pixar Hotel.\r\n<br>\r\n<br>\r\n<i><b><font color="#8B008B" size="16">Para que servem?</font></b></i>\r\n<br>\r\n<br>\r\n<li><a>Pinte</a> seus Quartos.</li>\r\n<li>Descole um <a>Gato</a> e <a>acessórios</a>.</li>\r\n<li><a>Aligue Mobis</a>.</li>\r\n<li>Qualquer negóco divertido a gente inventa.</li>\r\n<br>\r\n<br>\r\n<i><b><font color="#8B008B" size="16">Como ganho uns Duckets</font></b></i>\r\n<br>\r\n<br>\r\n<li>Entre diariamente! Quanto mais ativo, mais chances de ganhar.</li>\r\n<li>Você ganha por cada conquista como <a>Cidadão Pixar</a></li>\r\n<li>Qualquer surpresa que a gente inventar!</li>', '', '', '', '0', '', ''),
(7, -1, '', 'Mobi por Preço', 1, '0', '0', 1, '0', 7, 'pets2', 'catalog_header_roombuilder', 'furni_by_line_teaser', '', 'Há uma maneira muito fácil de encontrar o Mobi dos seus sonhos... Por preço!', 'Mobi por Preço:', 'Há várias opões disponíveis. Por favor, escolha o mais adequado através da lista suspensa.', '', '0', '', ''),
(8, -1, '', 'Mobis por Função', 121, '1', '1', 1, '0', 9, 'pets2', 'catalog_header_roombuilder', 'furni_by_line_teaser', '', 'Há uma maneira muito fácil de encontrar o Mobi de seus sonhos... Por tipo de Mobi!', 'Mobi por Item:', 'Há várias opões disponíveis. Por favor, escolha o mais adequado através da lista suspensa.', '', '0', '', ''),
(9, -1, '', 'Mobis por Coleção', 197, '1', '1', 1, '0', 10, 'pets2', '', '', '', 'Há uma maneira muito fácil de encontrar o Mobi de seus sonhos... Por Linha!', 'Mobi por Linha:', 'Há várias opões disponíveis. Por favor, escolha o mais adequado através da lista suspensa.', '', '0', '', ''),
(10, -1, '', 'Edição Limitada de Raros', 145, '1', '1', 1, '0', 11, 'default_3x3', 'limited_header', 'catalog_limited_teaser_en', '', 'Adquira enquanto há tempo! Edição Limitada de Raros só está disponível em quantidades limitadas. Uma vez que todas forem vendidas, acabou! Cada Mobi pode ser identificado pelo ID e o LTD logo abaixo deles.', '', '', '', '0', '', ''),
(11, -1, '', 'Pixar Câmbio', 146, '1', '1', 1, '0', 12, 'default_3x3', 'limited_header', 'catalog_bank_teaser', '', 'Troque suar Moedas por Câmbios, seus Câmbios por Mobis, seus Mobis por Câmbios', '', '', '', '0', '', ''),
(12, -1, '', 'Mascotes', 8, '1', '1', 1, '0', 13, 'pets2', '', '', '', 'Mascotes são habitantes do Pixar Hotel e, assim como seus donos, precisam de cuidados essenciais.', 'Algumas coisas que você deve saber:', '- Você pode colocar um Mascote no seu Quarto ou passear com ele em outros Quartos.<br>\r\n- Você não pode negociar Mascotes, mas eles podem ir ao Quarto dos seus amigos para ganhar carinho.<br>\r\n- Você pode ter no máximo 50 Mascotes no seu Quarto, mas cuide bem de todos!<br>\r\n- Confira as necessidades dele, como água, comida e brinquedos. Veja a seção Para Mascotes.<br>\r\n- Ganhe Emblemas de Conquista treinando seu Mascote.\r\n<br><br><br><br>\r\n<b>\r\n- Seu Mascote fica velho,                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    