                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          mas não morre. <br>\r\n-Você não pode negociar seu Mascote.\r\n</b>', '', '0', '', ''),
(13, -1, '', 'Loja de Filhotes', 228, '1', '0', 1, '0', 14, 'default_3x3', '', '', '', '', '', '', '', '0', '', ''),
(14, -1, '', 'Feira Livre', 69, '1', '1', 1, '0', 15, 'pets2', 'catalog_header_roombuilder', 'furni_by_line_teaser', '', 'Feira Livre é um jeito fácil e seguro de vender seus Mobis no Pixar.', 'Como a Feira Livre funciona?', 'Para vender itens: Você pode vender qualquer item do seu Inventário marcado como permitido. Basta selecionar o item no inventário e clicar no botão "Vender na Feira Livre". Você também poderá usar itens presentes na loja.\r\n<br><br>\r\nPara adquirir itens: Procure pelo que você quer comprar na página de ofertas da Feira Livre e clique em Adquirir. Garantimos que você vai receber o item pelo preço anunciado na mesma hora da compra.\r\n<br><br>\r\nO que é necessário: você precisa ter Permissão para Trocas, o qual poderá conseguir ao completar os primeiros passos do Percuso de Talentos.', '', '0', '', ''),
(15, -1, '', 'Diamantes', 92, '1', '1', 1, '0', 16, 'info_duckets', '', '', '', '<i><b><font color="#8B008B" size="16">O que são os Diamantes?</font></b></i>\r\n<br><br>\r\nDiamantes te recompensam por cada crédito que você adquirir! Se você adquirir 120 créditos no mesmo mês, você também ganha um bônus extra de 120 pontos!\r\n<br><br>\r\n<i><b><font color="#8B008B" size="16">Para que eles servem?</font></b></i>\r\n<br><br>\r\n<li> Itens <a>Raros</a> Exclusivos!</li>\r\n<li> Troque seus pontos por <a>créditos</a> (10 Diamantes te darão 1c).</li>\r\n<li> Troque seus pontos por <a>Pixar Clube</a></li>\r\n<br><br>\r\n<i><b><font color="#8B008B" size="16">Como eu consigo obtê-los</font></b></i>\r\n<br><br>\r\n<li> Adquira créditos e comece a colecionar!</li>\r\n\r\n', '', '', '', '0', '', ''),
(16, -1, '', 'Pixar Grupos', 203, '1', '1', 1, '0', 17, 'guild_frontpage', '', '', '', 'Os Grupos Pixars são a melhor forma de ficar próximos dos seus amigo e partilhas interesses com os outros. Cada Grupo tem um Quartel que pode ser decorado por todos os membros do Grupo. Os membros do Grupo ainda podem colorir Mobis exclusivos com as cores do Grupo.', '', '<b><font size="16">O que há de bom nos Pixars Grupos?</font></b>\r\n<br><br>\r\n*Conect-se com pessoas que você gosta!<br>\r\n*Decore o Quartel com os membros do Grupo<br>\r\n*Mostre a todos o Emblema do seu Grupo<br>\r\n*Adquira Mobis exclusivos com as cores do seu Grupo!', '', '0', '', ''),
(18, -1, '', 'Efeitos Permanentes', 61, '0', '0', 1, '0', 19, 'default_3x3', '', '', '', 'NOVO! Os efeitos permanentes chegaram! Está farto de comprar os mesmos efeitos várias vezes? Quer mané-los para sempre? Então, esta oferta foi feita para você!', '', '', '', '0', '', ''),
(19, -1, '', 'Fantasias', 205, '0', '0', 1, '0', 20, 'default_3x3', '', '', '', 'Com estas fantasias você vai ficar demais tanto no palco quanto caminhando sobre o tapete vermelho.', '', '', '', '0', '', ''),
(20, -1, '', 'Planta-monstro', 153, '1', '1', 1, '0', 21, 'pets2', '', '', '', 'As plantas-monstro são difíceis às vezes. Por isso, esta página dá outro conselho sobre os cuidados e o crescimento da sua cepa monstruosa.', 'O cuidado com a planta', 'Suas plantas precisam de cuidados regulares, senão elas morrem. Para garantir uma planta saudável, cuide dela a cada 30 horas aproximadamente. Se ela morrer, você pode usar a poção de reavivamento para fazê-la reviver.', '', '0', '', ''),
(21, -1, '', 'Wired', 80, '1', '1', 1, '0', 22, 'pets2', '', '', '', 'Mobis Wired lhedão infinitas possiblidad: você pode programar seus Mobis para fazerem qualquer coisa aprendendo a utilizar os Ativadores, Efeitos e Condições.', 'Como funciona?', 'Para tornar seu Quarto Wired você precisa conhecer os Mobis:\r\n<br><br>\r\n1.Ativadores: coisas que você precisa fazer para um Efeito funcionar.\r\n<br><br>\r\n2.Efeitos: coisas que acontecem quando você liga um Ativador.\r\n<br><br>\r\n3.Condições(opcionais):as condições necessárias para o Ativador funcionar.\r\n<br><br><br><br><br><br>\r\nCada um destes pode ser programado separadamente. Empilhe seu ativador com os Efeitos e Condições e eles trnasformarão o seu Quarto!', '', '0', '', ''),
(23, -1, '', 'Jogos', 202, '1', '1', 1, '0', 24, 'default_3x3', '', '', '', 'Há muitos jogos no gatilho... Preparado?', 'Escolha seu jogo:', 'Dê uma olhadela no menu Esportes e decida qual vai tentar primeiro. Preparado?\r\n', '', '0', '', ''),
(24, -1, '', 'Furnimatic', 7, '1', '1', 1, '0', 25, 'recycler', '', '', '', 'Insira seus Mobis velhos no Furnimatic e receba novos Mobis em troca! Confira os prêmios e as instruções de reciclagem. Arraste um Mobi até cada caixa abaixo e clique em ligar!', '', '', '', '0', '', ''),
(25, 9, '', 'Rústico', 37, '1', '1', 1, '0', 12, 'default_3x3', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', ' ', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(26, 9, '', 'Plástico', 46, '1', '1', 1, '0', 22, 'default_3x3', 'catalog_plasto_headline1', '', ' ', 'Throw on an afro and grab a disco ball! Feel that retro, 1970s vibe? You soon will with this colourful, plastic range! Choose a colour to suit your mood and off you go!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(27, 9, '', 'Banheiro', 17, '1', '1', 1, '0', 4, 'default_3x3', 'catalog_bath_headline1', 'catalog_bath_teaser1', ' ', 'Lets face it.. you can\'t live without your bathroom. Give yours guests somewhere to freshen up with our cheeful bathroom collection!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(28, 8, '', 'Plantas', 220, '1', '1', 1, '0', 7, 'default_3x3', 'catalog_plants_headline1', 'catalog_plants_teaser1', ' ', 'Every room needs a plant! Not only do they bring a bit of the outside inside, they also enhance the air quality! And what better gift for a friend than a beautiful rose or elegant fruit tree...', ' ', '', ' ', '0', '', ''),
(29, 8, '', 'Tapetes', 116, '1', '1', 1, '0', 9, 'default_3x3', 'catalog_rugs_headline1', 'catalog_rugs_teaser1', ' ', 'Rugs for all occasions, all non-slip and washable.', ' ', 'Click on an item for details.', ' ', '0', '', ''),
(30, 8, '', 'Bandeiras e Galerias', 47, '1', '1', 1, '0', 6, 'default_3x3', 'catalog_gallery_headline1', 'catalog_posters_teaser1', ' ', 'Adorn your walls with posters, art, plaques and wall hangings. This gallery is bursting with items to suit all tastes, traditional and modern!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(31, 8, '', 'Troféus', 221, '1', '1', 1, '0', 12, 'trophies', 'catalog_trophies_headline1', '', ' ', 'Everyones a winner with Habbo trophies! Now you can reward all your friends with our pre-polished array of trohpies. In bronze, silver and gold. \r\nFirst choose your trophy model, then the metal and carefully type your inscription. Don\'t worry, we\'ll engrave it all with your name and the date.', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(32, 9, '', 'Acessórios', 11, '1', '1', 1, '0', 1, 'default_3x3', 'catalog_extra_headline1', 'catalog_extra_teaser1', ' ', 'However you like to place your essential Furniture, it\'s the finishing touches that count!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(34, 9, '', 'Iced', 13, '1', '1', 1, '0', 10, 'default_3x3', 'catalog_iced_headline1', 'catalog_iced_teaser1', ' ', 'The Iced range, squishy, soft and most definitely cool. Whatever your needs, this stylish range should  cover it!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(35, 9, '', 'Alhambra', 12, '1', '1', 1, '0', 72, 'default_3x3', 'catalog_alh_headline1_en', 'catalog_alh_teaser1_en', ' ', 'For the cold Arabian nights and hot Arabian days, you\'ll need a palace.. and we have just what you need! Green blossom print should cover it just fine!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(36, 9, '', 'Asia', 15, '1', '1', 1, '0', 73, 'default_3x3', 'catalog_asian_headline1', 'catalog_asian_teaser1', ' ', 'Ting tong! Ching chong? Ting chong ting, ping ping! I mean uh.. with our authentic Chinese furniture, you can make a beautiful oriental room!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(37, 9, '', 'Bensalem', 18, '1', '1', 1, '0', 74, 'default_3x3', 'catalog_lc_headline2_en', 'catalog_lc_teaser1_en_001', ' ', 'Under the seaaaaaaaaa, oh, Under the seaaaaaa! What will your underwater world look like? We have it all here, crabs, HIV and genital warts!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(39, 9, '', 'Executivo', 27, '1', '1', 1, '0', 28, 'default_3x3', 'catalog_exe_headline1_en', 'catalog_exe_teaser_en', ' ', 'For the ultimate business man, the Executive range with its leather seats and Italian coffee is a dream! How about you try the easy lifestyle?', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(40, 9, '', 'Vidro', 29, '1', '1', 1, '0', 21, 'default_3x3', 'catalog_glass_headline1', 'catalog_glass_teaser1', ' ', 'You can really open up a space with this stylish glass furniture, just don\'t walk into it!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(41, 9, '', 'Gótico', 30, '1', '1', 1, '0', 29, 'default_3x3', 'catalog_gothic_headline1', 'catalog_gothic_teaser1', ' ', 'As the church bells ring out midnight, you walk through your cobbled hall lit by candles, throw yourself into your medieval throne and paint your nails black. This is what we imagined when we ordered this range!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(42, 9, '', 'Espotes', 56, '1', '1', 1, '0', 30, 'default_3x3', 'sports', 'catalog_sports_teaser1', ' ', 'Sport contains all those vital Olympic pieces from running tracks to basketball courts! 3 2 1 GO!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
(43, 9, '', 'Gangs', 32, '1', '1', 1, '0', 31, 'default_3x3', 'catalog_grunge_headline1', 'catalog_gru_teaser_en', ' ', 'Sleeping rough? Make the streets a bit more bearable with our collection of homeless furni, Grunge!', ' ', 'Click on an item for more information.', ' ', '0', '', ''),
