(544, 542, '', 'Upgrades do CA', 194, '1', '1', 1, '0', 1, 'builders_club_addons', '<b><font color="#d85b00" size="16">\r\nUpgrades do Clube do Arquiteto\r\n</font></b><br><br>\r\n<font align="justify">VocÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Âª alcanÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â§ou o  <b>Limite de Mobis </b> mas quer <b> continuar construindo? </b> NÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â£o hÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â¡ problema, faÃƒÆ’Ã†â€™Ãƒâ€šÃ‚Â§a um upgrade!\r\n                    ', '', '', '', '', '', '', '0', '', ''),
(545, -1, '', 'Bloco-a-Bloco', 28, '1', '0', 1, '0', 3, 'default', '', '', '', '', '1 Bloco... 2 Blocos... Bloco vermelho... Bloco Azul!', 'Com milhares de novas cores e formas para escolher, você pode deixar sua criatividade fluir livremente!<br>\r\nExclusivo para o Clube do Arquiteto.', '', '0', '', ''),
